import React from 'react';

class Filter extends React.Component{
    render() {
        return(
            <div className='row'>
                <div className='col-md-4'>
                    {this.props.count}
                </div>
                <div className='col-md-4'></div>
                <div className='col-md-4'></div>
            </div>
        )
    }
}


export default Filter;
